function textOutline(outline, name) {
	return new tcsvg.Constraints().and(			outline.width
			.ge(
					name.width
				.plus(
						(new tcsvg.Expression(__attribute__MARGIN()))
					.times(
						(new tcsvg.Expression(2))
					)
				)
			)
		.and(
				name.center
			.eq(
				outline.center
			)
		)
	.and(
			outline.height
		.ge(
				name.height
			.plus(
				(new tcsvg.Expression(__attribute__MARGIN()))
			)
		)
	)
	);
}
